import { useEffect, useState } from "react";
import NavbarComponent from "../components/Navbar";
import SidebarComponent from "../components/Sidebar";


const UsersPage = () => {
    // states
    const [refresh, setRefresh] = useState(false)
    const [users, setUsers] = useState([
        {
            "name": "user1",
            "mobile_no": "0000000000",
            "age": "22",
            "gender": "male",
            "status": "ACTIVE"
        },
        {
            "name": "user1",
            "mobile_no": "1111111111",
            "age": "30",
            "gender": "male",
            "status": "INACTIVE"
        },
        {
            "name": "user3",
            "mobile_no": "2222222222",
            "age": "19",
            "gender": "female",
            "status": "ACTIVE"
        },
        {
            "name": "user4",
            "mobile_no": "3333333333",
            "age": "22",
            "gender": "male",
            "status": "INACTIVE"
        },
        {
            "name": "user5",
            "mobile_no": "4444444444",
            "age": "30",
            "gender": "male",
            "status": "ACTIVE"
        },
        {
            "name": "user6",
            "mobile_no": "5555555555",
            "age": "19",
            "gender": "female",
            "status": "ACTIVE"
        },
        {
            "name": "user7",
            "mobile_no": "6666666666",
            "age": "19",
            "gender": "female",
            "status": "ACTIVE"
        },
        {
            "name": "user8",
            "mobile_no": "7777777777",
            "age": "19",
            "gender": "female",
            "status": "ACTIVE"
        },
        {
            "name": "user9",
            "mobile_no": "8888888888",
            "age": "19",
            "gender": "female",
            "status": "ACTIVE"
        },
        {
            "name": "user10",
            "mobile_no": "9999999999",
            "age": "19",
            "gender": "female",
            "status": "ACTIVE"
        },
        {
            "name": "user11",
            "mobile_no": "1010101010",
            "age": "19",
            "gender": "male",
            "status": "ACTIVE"
        },
        {
            "name": "user12",
            "mobile_no": "1212121212",
            "age": "19",
            "gender": "male",
            "status": "ACTIVE"
        },
        {
            "name": "user13",
            "mobile_no": "1313131313",
            "age": "19",
            "gender": "male",
            "status": "ACTIVE"
        },
        {
            "name": "user14",
            "mobile_no": "1414141414",
            "age": "19",
            "gender": "female",
            "status": "ACTIVE"
        },
    ])

    // use effect
    useEffect(() => {
        console.log('Refreshed');
    }, [refresh]);

    // status change
    const changeStatus = (index, status) => {
        users[index].status = status
        setUsers(users)
        setRefresh(!refresh)
    }

    // return
    return (
        <>
            <NavbarComponent />
            <SidebarComponent now={'users'} />
            <div className="w-10/12 min-h-screen px-3 pt-16 ml-80">
                <div className="w-full min-h-screen bg-gray-200 rounded-lg px-5 py-5 mt-3">
                    {/* Table */}
                    <div className="w-full bg-gray-100">
                        <table className="w-full table-auto border-collapse border border-gray-400">
                            <thead>
                                <tr>
                                    <th className="text-white text-md border border-gray-300 px-4 py-2 bg-gray-800 capitalize">
                                        No
                                    </th>
                                    <th className="text-white text-md border border-gray-300 px-4 py-2 bg-gray-800 capitalize">
                                        Name
                                    </th>
                                    <th className="text-white text-md border border-gray-300 px-4 py-2 bg-gray-800 capitalize">
                                        Mobile No
                                    </th>
                                    <th className="text-white text-md border border-gray-300 px-4 py-2 bg-gray-800 capitalize">
                                        Age
                                    </th>
                                    <th className="text-white text-md border border-gray-300 px-4 py-2 bg-gray-800 capitalize">
                                        Gender
                                    </th>
                                    <th className="text-white text-md border border-gray-300 px-4 py-2 bg-gray-800 capitalize">
                                        Status
                                    </th>
                                </tr>
                            </thead>
                            <tbody>
                                {users.map((item, index) => (
                                    <tr key={index}>
                                        <td className="border text-sm text-md border-gray-300 px-4 py-2">
                                            {index + 1}
                                        </td>
                                        <td className="border text-sm text-md border-gray-300 px-4 py-2">
                                            {item.name}
                                        </td>
                                        <td className="border text-sm text-md border-gray-300 px-4 py-2">
                                            {item.mobile_no}
                                        </td>
                                        <td className="border text-sm text-md border-gray-300 px-4 py-2">
                                            {item.age}
                                        </td>
                                        <td className="border text-sm text-md border-gray-300 px-4 py-2">
                                            {item.gender}
                                        </td>
                                        <td className="border text-xs border-gray-300 px-4 py-2">
                                            <div className="w-full flex justify-center">
                                                <div onClick={() => changeStatus(index, item.status === "ACTIVE" ? "INACTIVE" : "ACTIVE")} className="w-20 bg-gray-300 rounded-full shadow-md shadow-inner">
                                                    {
                                                        item.status === "ACTIVE" ?
                                                            <div className="flex w-14 py-1 bg-green-700 rounded-full text-white font-bold ml-auto justify-center status-box">
                                                                {item.status}
                                                            </div>
                                                            :
                                                            <div className="flex w-14 py-1 bg-red-600 rounded-full text-white font-bold justify-center status-box">
                                                                {item.status}
                                                            </div>
                                                    }
                                                </div>
                                            </div>
                                        </td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                    {/* Table */}
                </div>
            </div>
        </>
    );
}

export default UsersPage;
